import React from 'react';
import styled from 'styled-components';

function ResumeList() {
	return (
		<ComponentWrapper>
			<div className="ResumeContentList_ResumeContentList__header__zSUJW resume-list-header">
				경력
			</div>
			<p className="ResumeContentList_ResumeContentList_guide__PXAgY">
				• 담당하신 업무 중 우선순위가 높은 업무를 선별하여 최신순으로
				작성해주세요. <br />• 신입의 경우, 직무와 관련된 대외활동, 인턴,
				계약직 경력 등이 있다면 작성해주세요. <br />• 업무 또는 활동 시
				담당했던 역할과 과정, 성과에 대해 자세히 작성해주세요. <br />•
				업무 성과는 되도록 구체적인 숫자 혹은 [%]로 표현해주세요!
				<br />• 경력 조회 후 기업명이 실제와 다른 경우, 부서명/직책 란에
				원하시는 기업명을 작성해주세요.
			</p>
			<button type="button" className="Banner_Banner__jNlgA">
				<div className="Banner_Banner__content__vEDRv">
					<div className="Banner_Banner__text__eDwuj">
						<p>내 경력 정보를 한 번에 불러올까요?</p>
						<p className="Banner_subTitle__eINOg">
							기억 안 나는 경력 정보, 알아서 채워드려요!
						</p>
					</div>
					<div className="Banner_Banner__content__btn__fr27K">
						<strong>내 경력 한눈에 모아보기</strong>
						<svg width="12" height="12">
							<path
								fill="currentColor"
								d="M3.345 9.72a.75.75 0 0 0 1.06 1.06l4.25-4.25a.75.75 0 0 0 0-1.06l-4.25-4.25a.75.75 0 0 0-1.06 1.06L7.065 6l-3.72 3.72z"
							/>
						</svg>
					</div>
				</div>
			</button>
			<div className="ResumeContentList_ResumeContentList__body__TcdNe">
				<button
					type="button"
					className="ResumeContentList_ResumeContentList__body_btn_add__PGwYZ"
				>
					+ 추가
				</button>
			</div>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	.ResumeContentList_ResumeContentList__body_btn_add__PGwYZ {
		width: 100%;
		padding: 30px 0;
		display: block;
		font-size: 18px;
		font-weight: 600;
		text-align: left;
		border: none;
		border-radius: 0;
		color: #36f;
		font-family: inherit;
		background-color: transparent;
		border-bottom: 1px solid #f1f1f1;
	}
	.ResumeContentList_ResumeContentList__header__zSUJW {
		padding: 40px 0 6px;
		font-size: 16px;
		font-weight: 500;
		color: #3b3d40;
		border-bottom: 1px solid #bababa;
	}
	.ResumeContentList_ResumeContentList_guide__PXAgY {
		white-space: pre-wrap;
		padding: 10px;
		background-color: #f3f9fe;
		font-size: 12px;
		line-height: 1.42;
		letter-spacing: normal;
		color: #666;
		margin-top: 10px;
	}
	.Banner_Banner__jNlgA {
		display: flex;
		align-items: center;
		width: 100%;
		height: 70px;
		padding: 0 20px;
		border-radius: 3px;
		margin: 10px 0 20px;
		background: #f7f7f7;
		cursor: pointer;
	}
	.Banner_Banner__content__vEDRv {
		display: flex;
		align-items: center;
		justify-content: space-between;
		width: 100%;
		font-size: 15px;
		font-weight: 500;
		line-height: 18px;
		color: #333;
	}
	.Banner_Banner__text__eDwuj {
		display: inline-flex;
		text-align: left;
		p + p {
			margin-left: 2px;
		}
	}
	.Banner_Banner__content__btn__fr27K {
		display: flex;
		align-items: center;
		font-size: 14px;
		font-weight: 700;
		line-height: 17px;
		color: #36f;
		> svg {
			margin-left: 5px;
		}
	}
`;

export default ResumeList;
